"    <br/>",
"    <table cellpadding=\"4\" cellspacing=\"0\" summary=\"MedCalc 3000 Table\" width=\"70%\">",
"     <tr>",
"      <td bgcolor=\"#eeeeee\" width=\"1%\">",
"       <br/>",
"      </td>",
"      <td align=\"left\" bgcolor=\"#eeeeee\">",
"       <span class=\"medCalcFontTitleBox\">",
"        Assessment of Stunting",
"       </span>",
"      </td>",
"     </tr>",
"    </table>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <center>",
"     <table border=\"1\" cellpadding=\"4\" cellspacing=\"0\" summary=\"RRTable\">",
"      <tr id=\"rr1_1\">",
"       <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"        <span class=\"medCalcFontOneBold\">",
"         Z-Score &gt; -2:",
"        </span>",
"       </td>",
"       <td align=\"left\" style=\"border-left: 0px;\">",
"        <span class=\"medCalcFontOne\">",
"         No stunting",
"        </span>",
"       </td>",
"      </tr>",
"      <tr id=\"rr1_2\">",
"       <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"        <span class=\"medCalcFontOneBold\">",
"         Z-Score &gt; -3 and &lt;= -2:",
"        </span>",
"       </td>",
"       <td align=\"left\" style=\"border-left: 0px;\">",
"        <span class=\"medCalcFontOne\">",
"         Moderate stunting",
"        </span>",
"       </td>",
"      </tr>",
"      <tr id=\"rr1_3\">",
"       <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"        <span class=\"medCalcFontOneBold\">",
"         Z-Score &lt;= -3:",
"        </span>",
"       </td>",
"       <td align=\"left\" style=\"border-left: 0px;\">",
"        <span class=\"medCalcFontOne\">",
"         Severe stunting",
"        </span>",
"       </td>",
"      </tr>",
"     </table>",
"    </center>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <table cellpadding=\"4\" cellspacing=\"0\" summary=\"MedCalc 3000 Table\" width=\"70%\">",
"     <tr>",
"      <td bgcolor=\"#eeeeee\" width=\"1%\">",
"       <br/>",
"      </td>",
"      <td align=\"left\" bgcolor=\"#eeeeee\">",
"       <span class=\"medCalcFontTitleBox\">",
"        Assessment of Wasting",
"       </span>",
"      </td>",
"     </tr>",
"    </table>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <center>",
"     <table border=\"1\" cellpadding=\"4\" cellspacing=\"0\" summary=\"RRTable\">",
"      <tr id=\"rr2_1\">",
"       <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"        <span class=\"medCalcFontOneBold\">",
"         Z-Score &gt; -2:",
"        </span>",
"       </td>",
"       <td align=\"left\" style=\"border-left: 0px;\">",
"        <span class=\"medCalcFontOne\">",
"         No wasting",
"        </span>",
"       </td>",
"      </tr>",
"      <tr id=\"rr2_2\">",
"       <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"        <span class=\"medCalcFontOneBold\">",
"         Z-Score &gt; -3 and &lt;= -2:",
"        </span>",
"       </td>",
"       <td align=\"left\" style=\"border-left: 0px;\">",
"        <span class=\"medCalcFontOne\">",
"         Moderate wasting",
"        </span>",
"       </td>",
"      </tr>",
"      <tr id=\"rr2_3\">",
"       <td align=\"right\" nowrap=\"nowrap\" style=\"border-right: 0px\">",
"        <span class=\"medCalcFontOneBold\">",
"         Z-Score &lt;= -3:",
"        </span>",
"       </td>",
"       <td align=\"left\" style=\"border-left: 0px;\">",
"        <span class=\"medCalcFontOne\">",
"         Severe wasting",
"        </span>",
"       </td>",
"      </tr>",
"     </table>",
"    </center>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <span class=\"medCalcFontOneBold\">",
"     Notes",
"    </span>",
"    <ul class=\"medCalcFontOne\">",
"     <li>",
"      Moderate malnutrition is defined as moderate stunting or wasting.",
"     </li>",
"     <li>",
"      Severe malnutrition is defined as severe stunting or severe wasting,",
"or edematous malnutrition.",
"     </li>",
"     <li>",
"      Patients with edematous malnutrition (Kwashiorkor) should be considered to have",
"severe malnutrition even if stunting or wasting z-scores are not in the severe range.",
"     </li>",
"    </ul>",
"    <br/>",
"    &nbsp;",
"    <br/>",
"    <span class=\"medCalcFontRef\">",
"     <b>",
"      References",
"     </b>",
"    </span>",
"    <ol>",
"     <li>",
"      <span class=\"medCalcFontRef\">",
"       Percentile conversion from Z-Score is done by table look-up in the standard Normal Table. Percentiles are provided for Z Scores between -3.09 and 3.09.  Values beyond these extremes return percentiles of 0.1 and 99.9 respectively.",
"      </span>",
"     </li>",
